function sort (arr, inarr){ //sorts values in inarr based on arr
    var farr = []
    for(var i=0; i<inarr.length; i++) { inarr[i] = parseInt(inarr[i], 10); }
    arr.forEach(function(d){
        if (inarr.includes(d)){
            farr.push(d);
        }
    })
    return farr;
}



